import React from 'react';
import { Link } from 'react-router-dom';
import Footer from '../../../components/footer';
import Header from '../../../components/header/index'

function Home(){
    return (
        <div>
            <Header description={"Bem vindo ao Filme Collections"}/>
            <h1>Home</h1>
        <Footer/>
    </div>
    );   
}

export default Home;
